def is_substring(a, b):
    """
    >>> is_substring('a', 'a')
    True
    >>> is_substring('ab', 'a')
    False
    >>> is_substring('a', 'ab')
    True
    >>> is_substring('a', 'abab')
    True
    >>> is_substring('ab', 'abab')
    True
    >>> is_substring('abab', 'abab')
    True
    >>> is_substring('abab', 'ab')
    False
    >>> is_substring('ab', 'ababab')
    True
    >>> is_substring('abcabcabcabcabcabcabcabcabcabcabcab', 'a')
    True
    """
    if a == b:
        return True
    if len(a) > len(b):
        return False
    start = 0
    while True:
        if a == b[start:start+len(a)]:
            return True
        start += 1
        if start > len(b) - len(a):
            return False

